import React from 'react'

const TopIcons = () => {
  return (
    <div
      style={{
        color: "white",
        backgroundColor: "black",
        height: "35px",
        display: "flex",
        opacity: "0.9",
      }}
    >
      <img
        src={"https://pngimg.com/uploads/apple_logo/apple_logo_PNG19677.png"}
        style={{
          width: "25px",
          marginLeft: "1.9%",
          marginTop: "3.25px",
          height: "27px",
        }}
      />

      <div style={{ marginLeft: "5%", marginTop: "5px", fontWeight: "bold" , marginTop:"10%"}}>
        <button
          style={{
            border: "none",
            outline: "none",
            background: "none",
            color: "white",
          }}
        >
          F I L E
        </button>
        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <button
          style={{
            border: "none",
            outline: "none",
            background: "none",
            color: "white",
          }}
        >
          E D I T
        </button>
        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <button
          style={{
            border: "none",
            outline: "none",
            background: "none",
            color: "white",
          }}
        >
          H E L P
        </button>
      </div>
    </div>
  );
}

export default TopIcons
